//////////////////////////////////////////////////
//////////Compress Algorithm /////////////////////
//////////////////////////////////////////////////
void CompressDeMuraTable(BYTE *u8Tab, BYTE RGBindex)
{
    DWORD addr_h = 0, addr_v = 0, i = 0, Comp_Addr = 0, addr = 0;
    BYTE H_val = 0, L_val = 0, first_val = 0;

    for(i = 0 ; i < MAX_COMPRESS_NODES ; i++)
        g_u8CompressDeMuraTab[RGBindex][i] = 0;

    //check demura table (0 = 128)
    for(i = 0 ; i < MAX_NODES ; i++)
    {
        if(u8Tab[i] == 0)
            u8Tab[i] = 128;
    }

    for(addr_v = 0 ; addr_v < MAX_NODES_Ver; addr_v++)
    {
        //save first data
        g_u8CompressDeMuraTab[RGBindex][Comp_Addr] = u8Tab[addr_v*MAX_NODES_Hor];
        first_val = u8Tab[addr_v*MAX_NODES_Hor];

        Comp_Addr ++ ;

        for(addr_h = 0 ; addr_h < MAX_NODES_Hor-1 ; addr_h = addr_h + 8)
        {

            addr = addr_h + (addr_v*MAX_NODES_Hor) + 1;

            //save sign
            for(i = 0 ; i < 8 ; i++)
            {
                if((addr+i) % MAX_NODES_Hor == 0) //[0],[65],[130]
                {


                    if(u8Tab[addr + i] > first_val/*128*/)
                        g_u8CompressDeMuraTab[RGBindex][Comp_Addr] = _BIT7;
                }
                else
                {
                    if(u8Tab[addr + i] > u8Tab[addr + i - 1])
                        g_u8CompressDeMuraTab[RGBindex][Comp_Addr] += _BIT7 >> i;
                }
            }
            //DRVDEMURA_PRINT("\r c-sign - %x\n",g_u8CompressDeMuraTab[RGBindex][Comp_Addr]);
            Comp_Addr ++ ;

            //save diff
            for(i = 0 ; i < 8 ; i = i+2)
            {
                 if((addr+i) % MAX_NODES_Hor == 0)
                    H_val = ABS2(u8Tab[addr + i] , first_val/*128*/);
                else
                    H_val = ABS2(u8Tab[addr + i] , u8Tab[addr + i - 1]);

                L_val = ABS2(u8Tab[addr + i + 1] , u8Tab[addr + i]);

                g_u8CompressDeMuraTab[RGBindex][Comp_Addr]  =  (H_val<<4) + (L_val&0x0F);

                Comp_Addr ++ ;
            }
        }
    }

}

void drvCompressDeMura(void)
{
    BYTE u8buff[MAX_NODES];
    int i ;

    for( i = 0 ; i < MAX_NODES ; i++)
        u8buff[i] = _tableOfDemura.Nodes[i].GY[4];

    CompressDeMuraTable(&u8buff[0], 1);

    for( i = 0 ; i < MAX_NODES ; i++)
        u8buff[i] = _tableOfDemura.Nodes[i].RY[4];
    CompressDeMuraTable(&u8buff[0], 0);

    for( i = 0 ; i < MAX_NODES ; i++)
        u8buff[i] = _tableOfDemura.Nodes[i].BY[4];
    CompressDeMuraTable(&u8buff[0], 2);

}

void drvDeCompressDeMura(void)
{
#if ExtremeDataAlgorithm
       DWORD  addr = 0;
	BYTE  data = 0;
	BYTE  layer = 0;
	BYTE  ch =0;
	WORD idx =0,Vidx  = 0;
	unsigned int CompressDemuraTable[_demuraCompress.TableSize/4];
	int DecompressTable[MAX_NODES*3];
	int DecompressLen = 0;
	int retLen = 0;

	if( _demuraCompress.TableSize == (MAX_NODES*3))
	{
		for( addr = 0 ; addr < (MAX_NODES*3) ; ++addr)
			DecompressTable[addr] = _demuraCompress.CompressDeMuraTab[addr]; 
	}
	else	
	{	
		for( addr = 0 ; addr < (_demuraCompress.TableSize/4) ; addr+=1)
		{
			CompressDemuraTable[addr] = _demuraCompress.CompressDeMuraTab[4*addr] << 24;
			CompressDemuraTable[addr] |= _demuraCompress.CompressDeMuraTab[4*addr+1] <<16;
			CompressDemuraTable[addr] |= _demuraCompress.CompressDeMuraTab[4*addr+2] <<8;
			CompressDemuraTable[addr] |= _demuraCompress.CompressDeMuraTab[4*addr+3] ;
		}

		DecompressLen = 0;
		idx=0;
		while(DecompressLen < (_demuraCompress.HorSize*_demuraCompress.VerSize*3))
		{
		   retLen = readSS10(&CompressDemuraTable[idx], &DecompressTable[DecompressLen]);
		   idx +=1;
		   DecompressLen+=retLen; 
		}

		deDelta(DecompressTable,(_demuraCompress.HorSize*_demuraCompress.VerSize*3));
	}
	
	for (ch = 0; ch < 3; ch++)
	{
		for (Vidx = 0; Vidx < _demuraCompress.VerSize; ++Vidx)
		{
			for( idx = 0 ; idx < _demuraCompress.HorSize ; ++idx)
			{
				addr = idx+Vidx*_demuraCompress.HorSize + (_demuraCompress.VerSize*_demuraCompress.HorSize* ch);
				data = DecompressTable[addr]  & DataMask;
				for(layer = 0; layer < MAX_LAYERS; layer++)
				{
					 switch(ch)
					{
						case 0: _tableOfDemura.Nodes[idx+Vidx*MAX_NODES_Hor].RY[layer] = data; break;
						case 1: _tableOfDemura.Nodes[idx+Vidx*MAX_NODES_Hor].GY[layer] = data; break;
						case 2: _tableOfDemura.Nodes[idx+Vidx*MAX_NODES_Hor].BY[layer] = data; break;
					}
				}
			}
		}
	 
	}
#else
    DWORD i, j, w = 0, x, idx =0, Addr ;
    BYTE u8Sign;
    BYTE val[8];

    for(w = 0 ; w < 3 ; w++)
    {
        for(x = 0 ; x < MAX_NODES_Ver ; x++)
        {

            if(w ==0)
                _tableOfDemura.Nodes[idx].RY[4] = g_u8CompressDeMuraTab[w][x * MAX_COMPRESS_NODES_Hor];
            else if(w ==1)
                _tableOfDemura.Nodes[idx].GY[4] = g_u8CompressDeMuraTab[w][x * MAX_COMPRESS_NODES_Hor];
            else
                _tableOfDemura.Nodes[idx].BY[4] = g_u8CompressDeMuraTab[w][x * MAX_COMPRESS_NODES_Hor];

            val[7] = g_u8CompressDeMuraTab[w][x * MAX_COMPRESS_NODES_Hor];//128;

            idx = idx + 1;

            for(j = 0 ; j < (MAX_COMPRESS_NODES_Hor-5) ; j=j+5)
            {
                Addr = j + (x * MAX_COMPRESS_NODES_Hor );

                u8Sign = g_u8CompressDeMuraTab[w][Addr+1];

                if((u8Sign & _BIT7)>>7)
                    val[0] = val[7] + (g_u8CompressDeMuraTab[w][Addr+2]>>4) ;
                else
                    val[0] = val[7] - (g_u8CompressDeMuraTab[w][Addr+2]>>4) ;

                if((u8Sign & _BIT6)>>6)
                    val[1] = val[0] + (g_u8CompressDeMuraTab[w][Addr+2]&0x0F) ;
                else
                    val[1] = val[0] - (g_u8CompressDeMuraTab[w][Addr+2]&0x0F) ;

                if((u8Sign & _BIT5)>>5)
                    val[2] = val[1] + (g_u8CompressDeMuraTab[w][Addr+3]>>4) ;
                else
                    val[2] = val[1] - (g_u8CompressDeMuraTab[w][Addr+3]>>4) ;

                if((u8Sign & _BIT4)>>4)
                    val[3] = val[2] + (g_u8CompressDeMuraTab[w][Addr+3]&0x0F) ;
                else
                    val[3] = val[2] - (g_u8CompressDeMuraTab[w][Addr+3]&0x0F) ;

                if((u8Sign & _BIT3)>>3)
                    val[4] = val[3] + (g_u8CompressDeMuraTab[w][Addr+4]>>4) ;
                else
                    val[4] = val[3] - (g_u8CompressDeMuraTab[w][Addr+4]>>4) ;

                if((u8Sign & _BIT2)>>2)
                    val[5] = val[4] + (g_u8CompressDeMuraTab[w][Addr+4]&0x0F) ;
                else
                    val[5] = val[4] - (g_u8CompressDeMuraTab[w][Addr+4]&0x0F) ;

                if((u8Sign & _BIT1)>>1)
                    val[6] = val[5] + (g_u8CompressDeMuraTab[w][Addr+5]>>4) ;
                else
                    val[6] = val[5] - (g_u8CompressDeMuraTab[w][Addr+5]>>4) ;

                if(u8Sign & _BIT0)
                    val[7] = val[6] + (g_u8CompressDeMuraTab[w][Addr+5]&0x0F) ;
                else
                    val[7] = val[6] - (g_u8CompressDeMuraTab[w][Addr+5]&0x0F) ;

                for(i = 0 ; i < 8 ; i++)
                {

                    if(w ==0)
                    _tableOfDemura.Nodes[idx].RY[4] = val[i];
                    else if(w ==1)
                    _tableOfDemura.Nodes[idx].GY[4] = val[i];
                    else
                    _tableOfDemura.Nodes[idx].BY[4] = val[i];
                     idx = idx + 1;
                }
            }
        }
        idx = 0;
    }
#endif

    LoadDeMuraTabAllLayer();
}

