WORD CalcCompressCheckSum(void)
{
    int idx;
    WORD sum;
    sum = 0;
#if ExtremeDataAlgorithm
	for(idx = 0; idx < (_demuraCompress.TableSize); idx++)
	    sum ^= _demuraCompress.CompressDeMuraTab[idx];
	_demuraCompress.CheckSum = sum;
#else
	for(idx = 0; idx < MAX_COMPRESS_NODES; idx++)
	{
	    sum ^= g_u8CompressDeMuraTab[0][idx];
	    sum ^= g_u8CompressDeMuraTab[1][idx];
	    sum ^= g_u8CompressDeMuraTab[2][idx];
	}
#endif
    return sum;
}

void drvSaveCompressDemuraNodes(int len, int Tab_size)
{
	int i, j,w;
	DWORD addr;
	BYTE data[Tab_size];
	int v_size = MAX_NODES_Ver;

	for( w = 0 ; w < 3 ; w++)
	{
	    for( j = 0 ; j < v_size ; j++)
	    {
	        addr = _addrOfStoredTable + (j*Tab_size) + (w*len) ;

	        for( i = 0 ; i < Tab_size ; i++)
	            data[i] = g_u8CompressDeMuraTab[w][i + (j*Tab_size)];

	            //DRVDEMURA_PRINT("\r\n addr %x\n",addr);
	            NVRam_WriteTbl(addr, data, Tab_size);
	    }
	}


}

void drvSaveComprssDemuraTable(void)
{
    if (ADDR_DEMURA_BLOCK + CNT_DEMURA_BLOCK > NVRAM_SIZE)
    {
        DRVDEMURA_PRINT("[Demura] Out of memory, please check EEPROM size.\n");
        return;
    }
#if ExtremeDataAlgorithm
	NVRam_WriteWord(_addrOfStoredTable, _demuraCompress.TableSize);
	NVRam_WriteWord(_addrOfStoredTable+sizeof(_demuraCompress.TableSize), _demuraCompress.HorSize);
	NVRam_WriteWord(_addrOfStoredTable+sizeof(_demuraCompress.TableSize)+sizeof(_demuraCompress.HorSize), _demuraCompress.VerSize);
	NVRam_WriteTbl(_addrOfStoredTable+sizeof(_demuraCompress.TableSize)+sizeof(_demuraCompress.HorSize)+sizeof(_demuraCompress.VerSize), _demuraCompress.CompressDeMuraTab, _demuraCompress.TableSize);
	CalcCompressCheckSum();
	NVRam_WriteByte(_addrOfStoredTable+sizeof(_demuraCompress.TableSize)+sizeof(_demuraCompress.HorSize)+sizeof(_demuraCompress.VerSize)+sizeof(_demuraCompress.CompressDeMuraTab), _demuraCompress.CheckSum);
#else
    WORD ChkSum  = 0;
    drvSaveCompressDemuraNodes(MAX_COMPRESS_NODES, MAX_COMPRESS_NODES_Hor);
    //Currently, Only save the last layer (L255) data to EEPROM.
    ChkSum= CalcCompressCheckSum();
    WORD addr = _addrOfStoredTable + 3 * MAX_COMPRESS_NODES;
    NVRam_WriteTbl(addr,   (BYTE*)&ChkSum, 2);
#endif
}

